import React, { Fragment } from 'react';
import { connect } from 'react-redux';
import {productQuantity, clearProducts} from '../actions/productQuantity';
import {Link} from 'react-router-dom';
import '../cartstyles.css';

function Cart({props, productQuantity,clearProducts}) {

    console.log(props);

    let productsinCart = [];
    let productsBill = [];

    Object.keys(props.products).forEach(function(item){
        console.log(item);
        console.log(props.products[item].inCart);
        if(props.products[item].inCart) {
            productsinCart.push(props.products[item])
            productsBill.push(props.products[item])
        }
    })

    productsinCart = productsinCart.map((product) => {
        return (
            <Fragment>
            <div className = "product row no-gutters">
                <div className = "delete-icon col-sm- padding-0">
                    <ion-icon onClick={() => clearProducts(product.key)} name="trash-outline" className = "remove"></ion-icon>
                </div>
                <div className = "col-md- padding-0">
                    <img className = "imgcolumn" src = {product.image} />
                </div>
                <div className = "name-col col-md- padding-0">
                    <div className = "pname">{product.name}</div>
                    <div className = "quantity">
                        <ion-icon onClick = {() => productQuantity('increase',product.key)} name = "add-circle-outline" className = "increase">+</ion-icon>
                            {product.numbers}
                        <ion-icon onClick = {() => productQuantity('decrease',product.key)} name = "remove-circle-outline" className = "decrease">-</ion-icon>
                    </div>                     
                </div>
                <div className ="price-col col-md- padding-0">
                    <div className = "priceee">Rs {product.price}</div>
                    <div className = "timerrr">{product.preptime}</div>

                </div>
                <line color = "#fff"/>
            </div>
            </Fragment>

        )
    });


    productsBill = productsBill.map((product) => {
        return(
            <Fragment>
                <div className = "product-bill row">
                    <div className = "item col-md-">
                        <div className = "item-name">{product.name}</div>
                    </div>
                    <div className = "item-nums col-md-">
                        <div className = "nums">x {product.numbers}</div>
                    </div>
                    <div className = "item-subtotal col-md-">
                        <div className = "subtotal">Rs {product.numbers*product.price}</div>
                    </div>
                </div>
            </Fragment>
        )
    });


    return (

    <div className = "order">
        <div className = "order-details">ORDER DETAILS</div>
        <div className = "container-products">
            <div className = "products">
                {productsinCart}
            </div>
        </div>
        <div className = "container-bill">
            <div className = "order-now">
                ORDER NOW
            </div>
            {productsBill}
            <br/> <br/>
            <div className = "ddetails">
                <div className = "delivery"> Delivery</div>
                <p className = "delivery-cost">Rs 100</p>
            </div>
            <div className = "basketTotalContainer">
                <h4 className = "basketTotalTitle">TOTAL BILL</h4>
                <h4 className = "basketTotal">Rs {props.cartCost+100}</h4>
            </div>
            <br/>
            <Link to = "/checkout">
            <div className = "check">
            <button type="button" className="btn btn-success btn-lg">CHECKOUT</button>
            </div>
            </Link>
        </div>
     </div>

    )
}

const mapStateToProps = state => ({
    props: state.basketState
});

export default connect(mapStateToProps,{productQuantity,clearProducts})(Cart);
